import {Outlet} from 'react-router-dom';

import Subnavigation from '../layouts/subnavigation'
import SubnavItem from '../layouts/subnavitem'

import DefaultLogo from '../assets/logo-default.svg'

import styled from 'styled-components'
import '../styles/theme.css'

function Dashboards(){
  return (
    <StyledContainer>
      <Subnavigation title='Dashboards'>
        <SubnavItem to='all'>All Dashboards</SubnavItem>
        <SubnavItem to='saved1'>Saved Dashboard 1</SubnavItem>
        <SubnavItem to='saved2'>Saved Dashboard 2</SubnavItem>
      </Subnavigation>
      <Outlet/>
    </StyledContainer>
  )
}

const StyledContainer = styled('div')`
  display: grid;
  grid-template-columns: 200px auto;
`;

export default Dashboards;
